export type CellCommonAttributes = {
    /**
     * Whether to display line numbers on cell.
     */
    lineNumbers?: boolean
    /**
     * Whether the cell is readonly.
     */
    readOnly?: boolean
}

export type DisplayComponent<T = unknown> = {
    /**
     * Name of the component.
     */
    name: string
    /**
     * Return `true` if this display component handle the target data `t`.
     */
    isCompatible: (t: T) => boolean

    /**
     * Create the view from the target data `t`, `t` does satisfy the condition of `isCompatible`.
     */
    view: (t: T) => AnyVirtualDOM
}

export type JsCellAttributes = CellCommonAttributes & {
    /**
     * If the cell is reactive, Observables & Promises referenced are automatically resolved.
     * It uses a 'combineLatest' policy.
     */
    reactive: boolean
}

export type NotebookOptions = {
    /**
     * Whether to run all the cells of a notebook page when loaded.
     */
    runAtStart?: boolean
    /**
     * The default values for cell's attribute.
     */
    defaultCellAttributes?: CellCommonAttributes

    /**
     * Options for markdown parsing.
     */
    markdown?: MdParsingOptions
}

export type Scope = {
    /**
     * The `let` variables: keyed by their name and mapped to their values.
     */
    let: { [k: string]: unknown }
    /**
     * The `const` variables: keyed by their name and mapped to their values.
     */
    const: { [k: string]: unknown }

    /**
     * The exported globals of python runtime.
     */
    python: { [k: string]: unknown }
}

export type WorkerCellAttributes = CellCommonAttributes & {
    /**
     * Name (exported symbol) of the worker's pool used to execute the code.
     */
    workersPool: string
    /**
     * Whether to interpret code as JavaScript or Python (pyodide) snippet.
     */
    mode: 'javascript' | 'python'
    /**
     * The names of the captured variables forwarded to the worker along with the processing task.
     */
    capturedIn?: string[]
    /**
     * The names of the captured variable name forwarded to the main-thread from the worker.
     */
    capturedOut?: string[]
}

